import React, { useState, useEffect } from 'react';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import {
  Container,
  Grid,
  Paper,
  Typography,
  Box,
  Card,
  CardContent,
  CardMedia,
  Chip,
  Stack,
  Divider
} from '@mui/material';
import animalsData from './data/animals.json';

const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#2e7d32',
    },
    secondary: {
      main: '#ff9800',
    },
  },
});

function App() {
  const [animals, setAnimals] = useState(animalsData.animals);
  const [filters, setFilters] = useState({
    type: [],
    size: [],
    color: [],
    habitat: [],
    diet: []
  });

  const uniqueValues = (key) => {
    const values = new Set();
    animalsData.animals.forEach(animal => {
      if (Array.isArray(animal[key])) {
        animal[key].forEach(value => values.add(value));
      } else {
        values.add(animal[key]);
      }
    });
    return Array.from(values).sort();
  };

  const handleFilterClick = (category, value) => {
    setFilters(prev => {
      const currentValues = prev[category];
      const newValues = currentValues.includes(value)
        ? currentValues.filter(v => v !== value)
        : [...currentValues, value];

      return {
        ...prev,
        [category]: newValues
      };
    });
  };

  useEffect(() => {
    const filteredAnimals = animalsData.animals.filter(animal => {
      return Object.entries(filters).every(([key, values]) => {
        if (values.length === 0) return true;
        if (Array.isArray(animal[key])) {
          return values.some(value => animal[key].includes(value));
        }
        return values.includes(animal[key]);
      });
    });
    setAnimals(filteredAnimals);
  }, [filters]);

  const FilterSection = ({ title, category, values }) => (
    <Box sx={{ mb: 2 }}>
      <Typography variant="subtitle1" sx={{ mb: 1, fontWeight: 'bold' }}>
        {title}
      </Typography>
      <Stack direction="row" spacing={1} useFlexGap flexWrap="wrap">
        {values.map(value => (
          <Chip
            key={value}
            label={value}
            onClick={() => handleFilterClick(category, value)}
            color={filters[category].includes(value) ? "primary" : "default"}
            variant={filters[category].includes(value) ? "filled" : "outlined"}
            sx={{ mb: 1 }}
          />
        ))}
      </Stack>
    </Box>
  );

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container maxWidth="lg">
        <Box sx={{ my: 4 }}>
          <Typography variant="h3" component="h1" gutterBottom align="center">
            Madagaskar Wildlife Guide
          </Typography>

          <Paper sx={{ p: 3, mb: 4 }}>
            <FilterSection
              title="Type"
              category="type"
              values={uniqueValues('type')}
            />
            <Divider sx={{ my: 2 }} />
            <FilterSection
              title="Grootte"
              category="size"
              values={uniqueValues('size')}
            />
            <Divider sx={{ my: 2 }} />
            <FilterSection
              title="Kleur"
              category="color"
              values={uniqueValues('color')}
            />
            <Divider sx={{ my: 2 }} />
            <FilterSection
              title="Habitat"
              category="habitat"
              values={uniqueValues('habitat')}
            />
            <Divider sx={{ my: 2 }} />
            <FilterSection
              title="Dieet"
              category="diet"
              values={uniqueValues('diet')}
            />
          </Paper>

          <Grid container spacing={3}>
            {animals.map(animal => (
              <Grid item xs={12} sm={6} md={4} key={animal.id}>
                <Card>
                  <CardMedia
                    component="img"
                    height="200"
                    image={animal.image}
                    alt={animal.name}
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      {animal.name}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {animal.scientificName}
                    </Typography>
                    <Box sx={{ mt: 1 }}>
                      <Chip label={animal.type} size="small" sx={{ mr: 1 }} />
                      <Chip label={animal.size} size="small" sx={{ mr: 1 }} />
                      <Chip label={animal.habitat} size="small" />
                    </Box>
                    <Typography variant="body1" sx={{ mt: 2 }}>
                      {animal.description}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
